import React from 'react'
import styled from 'styled-components'

const CardEditorDiv = styled.div`
  flex-basis: 50%;
  border-right: 1px solid #9E7676;
`

const TitleH1 = styled.h1`
  color: #9E7676;
`

function CardEditor1210() {
  return (
    <CardEditorDiv>
      <h1>Card Editor</h1>
      <div>명함정보입력화면</div>
      <div>N분의 1로~~~</div>
    </CardEditorDiv>
  )
}

export default CardEditor1210
